import {Component, Inject} from '@angular/core';
import {EmpleadoBE} from '../EmployeeEntity/empleado-be';
import {HttpClient} from "@angular/common/http";
@Component({
  selector: 'app-add-employee',
  templateUrl: './add-employee.component.html',
  styleUrls: ['./add-employee.component.css']
})
export class AddEmployeeComponent {
  public _baseUrl:string;
  nuevoEmpleado:EmpleadoBE = {
    nombre:'',
    apellido:'',
  }
  constructor(private http:HttpClient,@Inject('BASE_URL_V2') baseUrl:string) {
    this._baseUrl = baseUrl;
  }
}
<hr>
<app-nav-menu-employee></app-nav-menu-employee>

<div class="employee-form">
  <h2>Agregar Empleado</h2>
  <form (ngSubmit)="agregarEmpleado()" #empleadoForm="ngForm">
    <div class="form-group">
      <label for="nombre">Nombre:</label>
      <input type="text" id="nombre" name="nombre" [(ngModel)]="nuevoEmpleado.nombre" required>
    </div>
    <div class="form-group">
      <label for="apellido">Apellido:</label>
      <input type="text" id="apellido" name="apellido" [(ngModel)]="nuevoEmpleado.apellido" required>
    </div>
    <button type="submit">Agregar Empleado</button>
  </form>
</div>
